import React from 'react'
import NavBar from '../../Components/NavBar'
import Header from '../../Components/Header'

const LandingPage = () => {
  useEffect(() => {
    if (user){
        return navigate('/home');
    }
}, [user, navigate]);
  return (
    <div>
      <NavBar/>
      <Header/>
    </div>
  )
}

export default LandingPage;
